import React from 'react';
import './Gallery.css'
import Navbar from '../../components/Navbar/Navbar';
import Footer from '../../components/Footer/Footer';
function Gallery() {
  return (
    <>
    <Navbar/>
    <div className='gallery-container'>
      <h1>Gallery</h1>
      </div>
    <Footer/>
    </>
  )
}

export default Gallery
